import { useState, useEffect, useContext } from 'react';
import UrlContext from '../context/UrlContext';
import 'bootstrap/dist/css/bootstrap.css';
import loadUserData from '../local-data/UserGet';


const TestsForPatient = async () => {
  const user = loadUserData();
  const url = useContext(UrlContext);
  const testListUrl = url + 'api/patient/get/all-tests/?patient_id=';

  try {
    const response = await fetch(`${testListUrl}${user.id}`);
    if (response.ok) {
      const jsonData = await response.json();
      const key = Object.keys(jsonData)[0]
      return jsonData[key];
    } else {
        return console.error('Error fetching test list:', response.status);
    }
  } catch (error) {
    return console.error('Error fetching test list:', error);
  }
}

export default TestsForPatient;
